import '../App.css';
import logo from '../logo.jpg';
function Navbar() {
    return (
        <div>
  <nav className="navbar navbar-expand-md ">
        <div className="collapse navbar-collapse  " id="navbarNav">
        <ul className="navbar-nav">
            <li className="nav-item"><a> <img src={ logo} alt="Logo" className='logo' style={{ height: '70px' }} />
</a>
      </li>
          <li className="nav-item"><a className="nav-link  " href="/">HOME       </a></li>
          <li className="nav-item"><a className="nav-link  " href="/Dashboard">Dashboard    </a></li>
          <li className="nav-item"><a className="nav-link " href="/BookAppointment">Book Appointment</a></li>
          <li className="nav-item"><a className="nav-link  " href="/MyAppointment">My Appointment</a></li>
          <li className="nav-item"><a className="nav-link " href="/Profile">profile</a></li>
          
           
        </ul>
      </div>
    
    </nav>
        </div>
    );  

}
export default Navbar;
